import React from "react";
import "../css/Header.css";

const Header = () => {
  return (
    <div class="content">
      <a id="menu-button"></a>
      <div id="hamburger-menu">
        <nav>
          <a href="">Home</a>
          <a href="">About</a>
          <a href="">Works</a>
          <a href="">Contact</a>
        </nav>
      </div>
      <div id="overlay"></div>
    </div>
  );
};

export default Header;
